import { InputBase } from '@mui/material';

export const fields1 = [
  {
    field: 'Name',
    required: '*',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'Gender',
    required: '*',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'Mother Name',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'Date of birth',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
    required: '*',
  },
  {
    field: 'Place of birth',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'KTP No.',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
    required: '*',
  },
  {
    field: 'Natoinal Card ID',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
    required: '*',
  },
  {
    field: 'Home Address 1',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'Home Address 2',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
];

export const fields2 = [
  {
    field: 'Mobile No.',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'Tel No.',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'Marriage Status',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'Bank Card No.',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'Bank Account No.',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'Bank Name',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'Family Card Number',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'Safety Insurance No.',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
  {
    field: 'Health Insurance No.',
    input: <InputBase sx={{ backgroundColor: 'rgb(241, 243, 245)' }} />,
  },
];
